void Delay100ms(uint32_t count)
{
	uint32_t volatile time;
  while(count>0){
    time = 727240;  // 0.1sec at 80 MHz
    while(time){
	  	time--;
    }
    count--;
  }
}

void Switch_Init(void)
{
	//----------------------------Port F-----------------------------------------
  uint32_t NOP;
  SYSCTL_RCGCGPIO_R |= 0x00000020;					//Initiate Port F Clock
  for (NOP=0; NOP<4; NOP++)									//Delay
	{
	}
  GPIO_PORTF_LOCK_R = 0x4C4F434B;						// Unlock Port F
  GPIO_PORTF_CR_R = 0x11;										//Allow Changes To PF0 and PF4
  GPIO_PORTF_DIR_R &= ~0x11;								//PF0 And PF4 Are Inputs
  GPIO_PORTF_AFSEL_R &= 0xEE;								//Disable Alternate Function For PF0 And PF4
  GPIO_PORTF_DEN_R |= 0x11;									//Digitally Enables PF0 And PF4
  GPIO_PORTF_PCTL_R &= 0xFFF0FFF0;					//Configure PF4,0 As GPIO
  GPIO_PORTF_AMSEL_R &= 0xEE;								//Disable Analog Function On PF0 And PF4
  GPIO_PORTF_PUR_R |= 0x11;									//Pull-Up Resistor For PF0 And PF4
  GPIO_PORTF_IS_R &= 0xEE;    							//PF4,PF0 Are Edge-Sensitive
  GPIO_PORTF_IBE_R &= 0xEE;									//PF4,PF0 iAre Not Both Edges
  GPIO_PORTF_IEV_R &= 0xEE;									//PF4,PF0 Falling Edge Event
  GPIO_PORTF_ICR_R = 0x11;									//Clear Flags For PF4,0
  GPIO_PORTF_IM_R |= 0x11;									//ARM Interrupt For PF4,PF0
  NVIC_PRI7_R = (NVIC_PRI7_R&0xFF00FFFF)|0x00400000;	//Priority 2
  NVIC_EN0_R |= 0x40000000;									//Enable Interrupt 30 In NVIC
	//----------------------------Port E-----------------------------------------
	SYSCTL_RCGCGPIO_R |= 0x00000010;					//Initiate Port E Clock
  for (NOP=0; NOP<4; NOP++)									//Delay
	{
	}
  GPIO_PORTE_CR_R = 0x03;										//Allow Changes To PE0 and PE1
  GPIO_PORTE_DIR_R &= 0xFC;									//PE0 And PE1 Are Inputs
  GPIO_PORTE_AFSEL_R &= 0xFC;								//Disable Alternate Function For PE0,1
  GPIO_PORTE_DEN_R |= 0x03;									//Digitally Enables PE0,1
  GPIO_PORTE_PCTL_R &= 0xFFF0FFF0;					//Configure PF4,0 As GPIO
  GPIO_PORTE_AMSEL_R &= 0xFC;								//Disable Analog Function On PE0,1
  GPIO_PORTE_IS_R &= 0xFC;    							//PE0, PE1 Are Edge-Sensitive
  GPIO_PORTE_IBE_R &= 0xFC;									//PE0, PE1 Are Not Both Edges
  GPIO_PORTE_IEV_R &= 0xFC;									//PE0, PE1 Falling Edge Event
  GPIO_PORTE_ICR_R = 0x03;									//Clear Flags For PE0,1
  GPIO_PORTE_IM_R |= 0x03;									//ARM Interrupt For PE0,1
  NVIC_PRI1_R = (NVIC_PRI1_R & 0xFFFFFF1F) | 0x00000040;	//Priority 2
  NVIC_EN0_R |= 0x0000010;										//Enable Interrupt 20 In NVIC
}

void GPIOPortE_Handler(void)
{
  if(GPIO_PORTE_RIS_R & 0x01)			//Switch 1
	{
    GPIO_PORTE_ICR_R = 0x01;  // acknowledge flag0
  }
	if(GPIO_PORTE_RIS_R & 0x02)			//Switch 2
	{
    GPIO_PORTE_ICR_R = 0x02;  // acknowledge flag1
		if (Red_Heart.health < 89)
		{
			Red_Heart.health += 10;
		}
		if ((room == 1)||(room == 3)||(room == 5))
		{
			ST7735_SetCursor(1, 0);
			LCD_OutDec(Red_Heart.health);
		}
  }
}

