void RoomScreen_Movement(void)
{
	if (data_x > 2500)
	{
		Frisk.x_position++;
		if (walk == 0)
		{
			ST7735_DrawBitmap(Frisk.x_position, Frisk.y_position, Right, 19, 36);
			walk = 1;
		}
		else if (walk == 1)
		{
			ST7735_DrawBitmap(Frisk.x_position, Frisk.y_position, Walking_Right, 19, 36);
			walk = 0;
		}
	}
	else if (data_x < 1500)
	{
		Frisk.x_position--;
		if (walk == 0)
		{
			ST7735_DrawBitmap(Frisk.x_position, Frisk.y_position, Left, 19, 36);
			walk = 1;
		}
		else if (walk == 1)
		{
			ST7735_DrawBitmap(Frisk.x_position, Frisk.y_position, Walking_Left, 19, 36);
			walk = 0;
		}
	}
}

void FightScreen_Movement(void)
{
	if (data_x > 2500)
	{
		Red_Heart.x_position++;
	}
	else if (data_x < 1500)
	{
		Red_Heart.x_position--;
	}
	if (data_y > 2500)
	{
		Red_Heart.y_position--;
	}
	else if (data_y < 1800)
	{
		Red_Heart.y_position++;
	}
	ST7735_DrawBitmap(Red_Heart.x_position, Red_Heart.y_position, Heart, 10, 10);
}

